/**
 * @description:
 * @author: LiuHu
 * @create: 2019-04-15 22:18
 **/
@RestController
@RequestMapping("/test")
@Slf4j
public class TestController {

    @Autowired
    private VenueTransportService venueTransportService;

    @Autowired
    private UserInfoService userInfoService;

    /**
     * 查询场馆信息，和开放的预定时间
     * @return
     */
    @GetMapping(value = "/venueInfo")
    public VenueEntityResponseBodyDto getVenueInfo() {
        VenueListResponseBodyDto responseBodyDto = venueTransportService.getVenueList();
        String venueId = responseBodyDto.getVenueEntityList().get(0).getVenueId();
        return venueTransportService.getVenueEntityInfo(venueId);
    }

    /**
     * 根据时间获取场地订购列表
     * @param date
     * @return
     */
    @GetMapping(value = "/venueOrders")
    public VenueOrderResponseBodyDto getVenueOrder(String date) {
        UserResponseBodyDto dto = userInfoService.getUserInfo("15365010926", "100030");
        return venueTransportService.getVenueOrder(date, dto.getUserId());
    }


    /**
     * 解码测试
     * @param args
     */
    public static void main(String[] args) {
        String str = "A6CBADC2C519E4396933771829B44F00630B71A677370E5CC29B1D91945DC9627AD2862D3EEB0A6CF833B61CC998298117B925A6F33AF52300EBA4D0F1BA744AE67E16FEA41A7C8835FB7B64EB7EA6BF2D0CF103E24723F978A7A63DE66E5407";
        System.out.println(EncryptionUtils.decodeFromAes(str,  GetKeyUtils.getKey("B")));

        String str2 = "";
        System.out.println(EncryptionUtils.decodeFromAes(str2,  GetKeyUtils.getKey("B")));

        String str3 = "";
        System.out.println(EncryptionUtils.decodeFromAes(str3,  GetKeyUtils.getKey("8")));

    }

    @Scheduled(initialDelay = 5000, fixedRate = 60000)
    public void getVenueOrder() {
        VenueOrderResponseBodyDto responseBodyDto = getVenueOrder("2019-04-26");
        if (null == responseBodyDto || responseBodyDto.getSellOrderMap().isEmpty()) {
            log.info("Orders is empty!");
            return;
        }
        log.info("Orders = {}", responseBodyDto.getSellOrderMap());
    }
}
